import React from 'react'
import SlideShow from '../../../components/UI/SlideShow'
import Cooperation from './Cooperation';
import WelcomPrg from './WelcomPrg';
import styles from '../../../assets/cssModules/homepage.module.css'
const Welcome = () => {
    return (
        <section id="welcome" >
            <div className="jumbotron jumbotron-fluid">

                {/* Welcome Paragraph */}
                <WelcomPrg />
                {/* End Welcome Paragraph */}

                {/* Slide Show */}
                <SlideShow />
                {/* End Slide Show */}

                {/* Cooperation */}
                <Cooperation />
                {/* Cooperation */}
            </div>
        </section>
    )
}

export default Welcome;
